int main() {
	std::cout << "Podaj liczby calkowite. 0 konczy wczytywanie: ";
	int liczba, parzyste{ -1 }, nieparzyste{};
	do {
		std::cin >> liczba;
		liczba % 2 == 0 ? ++parzyste : ++nieparzyste;
	} while (liczba != 0);
	std::cout << "Parzyste: " << parzyste << std::endl;
	std::cout << "Nieparzyste: " << nieparzyste << std::endl;
	return 0;
}

